Associated constants are constants associated with a type and can be declared in an impl block or in a trait definition. Associated constants declared inside a trait definition may omit their initializers to indicate that each implementation of the trait must specify those initializers. The identifier is the name of the constant used in the path. The type is the type that the definition has to implement. You can define an associated const directly in the interface surface of a trait: script; trait ConstantId { const ID: u32 = 0;
} Alternatively, you can also declare it in the trait, and implement it in the interface of the types implementing the trait. script; trait ConstantId { const ID: u32;
} struct Struct {} impl ConstantId for Struct { const ID: u32 = 1;
} fn main() -> u32 { Struct::ID
}

