Sway supports advanced pattern matching through exhaustive match expressions. Unlike an if expression, a match expression asserts at compile time that all possible patterns have been matched. If you don't handle all the patterns, you will get compiler error indicating that your match expression is non-exhaustive. The basic syntax of a match expression is as follows: let result = match expression { pattern1 => code_to_execute_if_expression_matches_pattern1, pattern2 => code_to_execute_if_expression_matches_pattern2, pattern3 | pattern4 => code_to_execute_if_expression_matches_pattern3_or_pattern4 ... _ => code_to_execute_if_expression_matches_no_pattern,
} Some examples of how you can use a match expression: script; // helper functions for our example
fn on_even(num: u64) { // do something with even numbers
}
fn on_odd(num: u64) { // do something with odd numbers
} fn main(num: u64) -> u64 { // Match as an expression let is_even = match num % 2 { 0 => true, _ => false, }; // Match as control flow let x = 12; match x { 5 => on_odd(x), _ => on_even(x), }; // Match an enum enum Weather { Sunny: (), Rainy: (), Cloudy: (), Snowy: (), } let current_weather = Weather::Sunny; let avg_temp = match current_weather { Weather::Sunny => 80, Weather::Rainy => 50, Weather::Cloudy => 60, Weather::Snowy => 20, }; let is_sunny = match current_weather { Weather::Sunny => true, Weather::Rainy | Weather::Cloudy | Weather::Snowy => false, }; // match expression used for a return let outside_temp = Weather::Sunny; match outside_temp { Weather::Sunny => 80, Weather::Rainy => 50, Weather::Cloudy => 60, Weather::Snowy => 20, }
}

