break and continue keywords are available to use inside the body of a while or for loop. The purpose of the break statement is to break out of a loop early: fn break_example() -> u64 { let mut counter = 1; let mut sum = 0; let num = 10; while true { if counter > num { break; } sum += counter; counter += 1; } sum // 1 + 2 + .. + 10 = 55
} The purpose of the continue statement is to skip a portion of a loop in an iteration and jump directly into the next iteration: fn continue_example() -> u64 { let mut counter = 0; let mut sum = 0; let num = 10; while counter < num { counter += 1; if counter % 2 == 0 { continue; } sum += counter; } sum // 1 + 3 + .. + 9 = 25
}

