Generic storage maps are available in the standard library as StorageMap<K, V> which have to be defined inside a storage block and allow you to call insert() and get() to insert values at specific keys and get those values respectively. Refer to Storage Maps for more information about StorageMap<K, V>. Warning While the StorageMap<K, V> is currently included in the prelude, to use it the Hash trait must still be imported. This is a known issue and will be resolved. use std::hash::Hash; use std::storage::storage_vec::*; use std::storage::storage_bytes::*; use std::storage::storage_string::*; storage { storage_map: StorageMap<u64, bool> = StorageMap {}, storage_vec: StorageVec<b256> = StorageVec {}, storage_string: StorageString = StorageString {}, storage_bytes: StorageBytes = StorageBytes {},
} abi StorageExample { #[storage(write)] fn store_map(); #[storage(read)] fn get_map(); #[storage(write)] fn store_vec(); #[storage(read, write)] fn get_vec(); #[storage(write)] fn store_string(); #[storage(read)] fn get_string(); #[storage(write)] fn store_bytes(); #[storage(read)] fn get_bytes();
