To deliver an experience akin to the EVM's access control, the std library provides a msg_sender function, which identifies a unique caller based upon the call and/or transaction input data. contract; abi MyOwnedContract { fn receive(field_1: u64) -> bool;
} const OWNER = Address::from(0x9ae5b658754e096e4d681c548daf46354495a437cc61492599e33fc64dcdc30c); impl MyOwnedContract for Contract { fn receive(field_1: u64) -> bool { let sender = msg_sender().unwrap(); if let Identity::Address(addr) = sender { assert(addr == OWNER); } else { revert(0); } true }
} The msg_sender function works as follows: If the caller is a contract, then Ok(Sender) is returned with the ContractId sender variant. If the caller is external (i.e. from a script), then all coin input owners in the transaction are checked. If all owners are the same, then Ok(Sender) is returned with the Address sender variant. If the caller is external and coin input owners are different, then the caller cannot be determined and a Err(AuthError) is returned.

