When a contract is compiled, a special section called "contract selection" is also generated. This section checks if the contract call method matches any of the available ABI methods. If this fails, one of two possible actions will happen: 1 - if no fallback function was specified, the contract will revert; 2 - otherwise, the fallback function will be called. For all intents and purposes the fallback function is considered a contract method, which means that it has all the limitations that other contract methods have. As for the fallback function signature, the function cannot have arguments, but it can return anything. If for some reason the fallback function needs to returns different types, the intrinsic __contract_ret can be used. contract; abi MyContract { fn some_method();
} impl MyContract for Contract { fn some_method() { }
} #[fallback]
fn fallback() {
} You may still access the method selector and call arguments in the fallback function. For instance, let's assume a function fn foobar(bool, u64) {} gets called on a contract that doesn't have it, with arguments true and 42. It can execute the following fallback: #[fallback]
fn fallback() { // the method selector is the first four bytes of sha256("foobar(bool,u64)") // per https://fuellabs.github.io/fuel-specs/master/protocol/abi#function-selector-encoding let method_selector = std::call_frames::first_param::<u64>(); // the arguments tuple is (true, 42) let arguments = std::call_frames::second_param::<(bool, u64)>();
}

