} trait Ord: Eq { fn gte(self, b: Self) -> bool;
} impl Ord for u64 { fn gte(self, b: Self) -> bool { // As `Eq` is a supertrait of `Ord`, `Ord` can access the equals method self.equals(b) || self.gt(b) }
